import React from "react";
import "../css_styles/cards.css";
import { Link } from "react-router-dom";
import { Grid } from "@mui/material";

const Cards = ({ tech }) => {
  return (
    <div className="card">
      <Grid>
        <Grid item lg={3} md={3} sm={6} xs={1} className="card-ads"></Grid>
        <Link to="/news-detail">
          <Grid className="card-content">
            <img src={tech.urlToImage} alt="" />
            <h2 className="cards__title">{tech.title}</h2>
          </Grid>
        </Link>
        <Grid className="card-ads"></Grid>
      </Grid>
    </div>
  );
};

export default Cards;
